import React, { useState } from 'react';
import './Sell.css';

const Sell = () => {
  const [message, setMessage] = useState('');
  const [showMessage, setShowMessage] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    const form = e.target;
    const date = form.elements['date'].value;
    const time = form.elements['time'].value;
    if (date && time) {
      setMessage(
        <b>Your Inspection has been booked for {date} at {time}.</b>
      );
      setShowMessage(true);
      setTimeout(() => setShowMessage(false), 3500);
      form.reset();
    }
  };

  return (
    <div className="sell-container">
      <h1 className="sell-title">Sell Your Car</h1>
      <form className="sell-form" onSubmit={handleSubmit}>
        <div className="sell-form-group">
          <label>Brand</label>
          <input className="sell-input" type="text" name="brand" value={form.brand} onChange={handleChange} required />
        </div>
        <div className="sell-form-group">
          <label>Model</label>
          <input className="sell-input" type="text" name="model" value={form.model} onChange={handleChange} required />
        </div>
        <div className="sell-form-group">
          <label>Year</label>
          <input className="sell-input" type="number" name="year" value={form.year} onChange={handleChange} required />
        </div>
        <div className="sell-form-group">
          <label>Price</label>
          <input className="sell-input" type="number" name="price" value={form.price} onChange={handleChange} required />
        </div>
        <button className="sell-btn" type="submit">Submit</button>
      </form>
    </div>
  );
};
export default Sell;
